import ReactDOM from 'react-dom';

export const Component1 = () => {
    const style = {
        position: 'fixed',
        left: '30px',
        top: '10px',
        background: 'goldenrod',
        width: '100px',
        height: '100px',
        zIndex: '1'
    };
    return ( <div 
        style = { style } >
        z - index: 1 </div>
    );
};
